import React from "react";

function NavBar() {
  return (
    <>
      <header className="game-header">
        <h1 className="game-title">Mexican Train Dominoes</h1>
        <img 
          loading="lazy" 
          src="https://cdn.builder.io/api/v1/image/assets/TEMP/454567658b547d84431fbbdf8224a75d18594956415276dd425887318929e8c0?apiKey=7293d20271ec4f72a58fe358903b4fd6&" 
          alt="Mexican Train Dominoes Game" 
          className="game-image"
        />
      </header>
      <style jsx>{`
        .game-header {
          justify-content: space-between;
          display: flex;
          gap: 20px;
          color: #fff;
        }
        .game-title {
          font-size: 72px;
          font-weight: 400;
          font-family: DM Serif Display, -apple-system, Roboto, Helvetica, sans-serif;
          flex-grow: 1;
        }
        .game-image {
          aspect-ratio: 1.01;
          object-fit: cover;
          width: 80px;
          margin: auto 0;
        }

        @media (max-width: 991px) {
          .game-header {
            flex-wrap: wrap;
          }
          .game-title {
            font-size: 40px;
            max-width: 100%;
          }
             `}</style>
    </>
  );
}

export default NavBar;
